syntax = "proto2";

package trck;

message Result {
  message Tuple_z {
    required string field_cookie = 1;
    required int64 field_timestamp = 2;
    required string field_a = 3;
    required string field_b = 4;
  }
  required string param_a = 1;
  required string param_b = 2;
  repeated string var_x = 3;
  required int64 var_y = 4;
  repeated Tuple_z var_z = 5;
}
